export const payload_locked_documents_rels = sqliteTable(
  'payload_locked_documents_rels',
  {
    id: integer('id').primaryKey(),
    order: integer('order'),
    parent: integer('parent_id').notNull(),
    path: text('path').notNull(),
    mediaID: integer('media_id'),
    usersID: integer('users_id'),
    'insurance-carrierID': integer('insurance_carrier_id'),
    'industry-categoryID': integer('industry_category_id'),
    'industries-servedID': integer('industries_served_id'),
    servicesID: integer('services_id'),
    'payload-foldersID': integer('payload_folders_id'),
  },
  (columns) => [
    index('payload_locked_documents_rels_order_idx').on(columns.order),
    index('payload_locked_documents_rels_parent_idx').on(columns.parent),
    index('payload_locked_documents_rels_path_idx').on(columns.path),
    index('payload_locked_documents_rels_media_id_idx').on(columns.mediaID),
    index('payload_locked_documents_rels_users_id_idx').on(columns.usersID),
    index('payload_locked_documents_rels_insurance_carrier_id_idx').on(
      columns['insurance-carrierID'],
    ),
    index('payload_locked_documents_rels_industry_category_id_idx').on(
      columns['industry-categoryID'],
    ),
    index('payload_locked_documents_rels_industries_served_id_idx').on(
      columns['industries-servedID'],
    ),
    index('payload_locked_documents_rels_services_id_idx').on(columns.servicesID),
    index('payload_locked_documents_rels_payload_folders_id_idx').on(columns['payload-foldersID']),
    foreignKey({
      columns: [columns['parent']],
      foreignColumns: [payload_locked_documents.id],
      name: 'payload_locked_documents_rels_parent_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['mediaID']],
      foreignColumns: [media.id],
      name: 'payload_locked_documents_rels_media_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['usersID']],
      foreignColumns: [users.id],
      name: 'payload_locked_documents_rels_users_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['insurance-carrierID']],
      foreignColumns: [insurance_carrier.id],
      name: 'payload_locked_documents_rels_insurance_carrier_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['industry-categoryID']],
      foreignColumns: [industry_category.id],
      name: 'payload_locked_documents_rels_industry_category_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['industries-servedID']],
      foreignColumns: [industries_served.id],
      name: 'payload_locked_documents_rels_industries_served_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['servicesID']],
      foreignColumns: [services.id],
      name: 'payload_locked_documents_rels_services_fk',
    }).onDelete('cascade'),
    foreignKey({
      columns: [columns['payload-foldersID']],
      foreignColumns: [payload_folders.id],
      name: 'payload_locked_documents_rels_payload_folders_fk',
    }).onDelete('cascade'),
  ],
)

